(15,19,1,'<p><strong>Hukum gravitasi Newton</strong> adalah kesimpulan Newton \nbahwa gaya tarik gravitasi yang bekerja antara dua benda sebanding \ndengan massa masing-masing benda dan berbanding terbalik dengan kuadrat \njarak kedua benda. Gravitasi bumi merupakan salah satu ciri bumi, yaitu \nbenda-benda ditarik ke arah pusat bumi. Gaya tarik bumi terhadap \nbenda-benda ini dinamakan gaya gravitasi bumi.<br>\n  Besar  gaya tarik-menarik ini berbanding lurus dengan massa  \nmasing-masing benda dan berbanding terbalik dengan  kuadrat jarak antara\n keduanya.</p>\n<p><img src=\"https://sumberbelajar.belajar.kemdikbud.go.id/file_storage/t2016/k42_66/media/rumus_besar_gaya_tarik.jpg\" width=\"101\" height=\"40\"></p>\n<p>Dimana:<br>\nF = gaya tarik gravitasi (N)<br>\nm<sub>1</sub>, m<sub>2</sub> = massa masing-masing benda (kg)<br>\nr = jarak antara kedua benda (m)<br>\nG = konstanta gravitasi umum (6,673 x 10<sup>–11</sup>Nm<sup>2</sup>/kg<sup>2</sup>)</p>\n<p>Hal yang perlu diperhatikan dalam penggunaan <strong>hukum gravitasi</strong> Newton adalah:</p>\n<ul><li>Benda dianggap partikel atau berbentuk bola</li><li>Garis kerja gaya terletak antara garis hubung yang menghubungkan pusat benda 1 dan pusat benda ke-2</li><li>F<sub>12</sub>, <strong>gaya gravitasi</strong> pada benda 1 yang dikerjakan oleh benda 2(disebut F <em>aksi</em>), F<sub>2,1</sub>, adalah gaya gravitasi yang  dilakukan pada benda 2 oleh benda 1(disebut F <em>reaksi</em>)</li></ul>','','',NULL),
(16,21,1,'<p><strong><a href=\"https://rumusrumus.com/hukum-gravitasi-newton\">Bunyi Hukum Gravitasi Newton</a></strong></p><p style=\"text-align: justify;\">Adapun\n untuk Bunyi Hukum Gaya Gravitasi Newton berbunyi, ” Setiap Massa \nmenarik Massa yang lain dengan Gaya Segaris yg menghubungkan antara \nkedua Inti Massa dan Besarnya Gaya Tarik yg terjadi, berbanding lurus \ndgn perkalian kedua Massa &amp;&nbsp;Berbanding terbalik dgn Kuadrat Jarak \nantara Kedua titik Massa Tersebut.</p><div style=\"float: none; margin:10px 0 10px 0; text-align:center;\"> <ins class=\"adsbygoogle\" style=\"display: block; text-align: center; height: 0px;\" data-ad-layout=\"in-article\" data-ad-format=\"fluid\" data-ad-client=\"ca-pub-2288346872467082\" data-ad-slot=\"2868759939\" data-adsbygoogle-status=\"done\"><ins id=\"aswift_4_expand\" style=\"display: inline-table; border: medium none; height: 0px; margin: 0px; padding: 0px; position: relative; visibility: visible; width: 630px; background-color: transparent;\"><ins id=\"aswift_4_anchor\" style=\"display: block; border: medium none; height: 0px; margin: 0px; padding: 0px; position: relative; visibility: visible; width: 630px; background-color: transparent; overflow: hidden; opacity: 0;\"></ins></ins></ins>  </div><p style=\"text-align: justify;\">Teori\n mengenai Hukum Gravitasi Newton tersebut telah dikembangkan lebih jauh \nlg bahwa disetiap Benda Angkasa akan saling Tarik – Menarik dan ini \ndapat menjelaskan mengapa Bumi terus berputar mengelilingi Sang Matahari\n untuk mengimbangi Gaya Tarik – Menarik Gravitas Bumi – Matahari \nsehingga dengan memakai Fenomena tarik menarik Gravitasi ini juga dapat \nmenjelaskan bahwa Meteor yg mendekat ke Planet Bumi di Ruang Angkasa \nakan tertarik oleh Gaya Gravitasi Bumi dan Jatuh ke Bumi.</p><p style=\"text-align: justify;\">Kemudian Sir Isaac Newton sendiri didalam Tulisannya di Journal&nbsp;<em>Philosophiae Naturalis Principia Mathematica&nbsp;</em>ditanggal\n 5 Juli 1687 lalu menjelaskan secara lebih detail tentang Gaya Gravitasi\n dalam bentuk Rumus yang diberi nama sebagai Rumus Gaya Gravitasi \nNewton.</p><p style=\"text-align: justify;\">Newton.</p><h3 style=\"text-align: justify;\"><a href=\"https://rumusrumus.com/rumus-gravitasi-newton/\"><strong>Rumus Gravitasi Newton Fisika Dasar</strong></a></h3><p><a href=\"https://rumusrumus.com/wp-content/uploads/2017/01/rumus-gravitasi-newton-lengkap.jpg\"><img class=\"alignnone size-full wp-image-961 lazyloaded\" src=\"https://rumusrumus.com/wp-content/uploads/2017/01/rumus-gravitasi-newton-lengkap.jpg\" alt=\"rumus gravitasi newton lengkap\" data-lazy-srcset=\"https://rumusrumus.com/wp-content/uploads/2017/01/rumus-gravitasi-newton-lengkap.jpg 560w, https://rumusrumus.com/wp-content/uploads/2017/01/rumus-gravitasi-newton-lengkap-300x97.jpg 300w\" data-lazy-sizes=\"(max-width: 560px) 100vw, 560px\" data-lazy-src=\"https://rumusrumus.com/wp-content/uploads/2017/01/rumus-gravitasi-newton-lengkap.jpg\" data-was-processed=\"true\" width=\"560\" height=\"181\"></a></p><p style=\"text-align: justify;\">Perlu\n kalian ingatkan sebagai Pelajar Siswa Siswi khususnya tingkat SMP \n(Sekolah Menengah Pertama) dan SMA (Sekolah Menengah Atas) bahwa <strong>Rumus Gravitasi Newton</strong>\n ini sering muncul di Soal Ujian Sekolah ataupun di Soal Ujian Nasional \n(UN) sehingga kalian sebagai pelajar Siswa Siswi harus benar – benar \ndapat memahami atau mengerti tentang Rumus Gravitasi Newton didalam \nRumus Dasar Fisika ini agar nantinya kalian bisa mengerjakan Soal – Soal\n Ujian Nasional dan Ujian Sekolah terkait Gravitasi maka anda bisa \nmengerjakannya dengan mudah.</p>','','',NULL),
